
DROP TABLE IF EXISTS `City`;
CREATE TABLE `City` (
  `city` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `country` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '',
  `id` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

DROP TABLE IF EXISTS `MonthlyAvg`;
CREATE TABLE `MonthlyAvg` (
  `dryDays` decimal(65,30) NOT NULL DEFAULT '0.000000000000000000000000000000',
  `high` decimal(65,30) NOT NULL DEFAULT '0.000000000000000000000000000000',
  `id` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `low` decimal(65,30) NOT NULL DEFAULT '0.000000000000000000000000000000',
  `month` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'Jan',
  `rainfall` decimal(65,30) NOT NULL DEFAULT '0.000000000000000000000000000000',
  `snowDays` decimal(65,30) NOT NULL DEFAULT '0.000000000000000000000000000000',
  `city` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `city` (`city`),
  CONSTRAINT `monthlyavg_ibfk_1` FOREIGN KEY (`city`) REFERENCES `City` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;




